 Телефоныңыз автоматты түрде мына әрекеттерді орындайды:
 • құтқару қызметтеріне қоңырау шалу;
 • төтенше жағдайға арналған контактілермен ақпарат бөлісу;
 • бейне жазу."

"Төтенше жағдайға арналған контактілер келесілер көрсетілген мәтіндік хабар алады:

• атыңыз;
• нақты уақыттағы орналасқан орныңыздың Maps сілтемесі;
• Personal Safety қолданбасы туралы ақпарат;
• бөлісу себебіңіз (міндетті емес);
• күй жаңалықтары, мысалы, қоңырау шалған уақытыңыз (міндетті емес)."
